eval("module.exports = {\n    parts: {\n        \"panels\": {\n            name: \"Solar Panels\",\n            description: \"The lander will deploy two nearly circular, 10-sided solar arrays, each 7.05 feet (2.15 meters) in diameter, extending from opposite sides of the lander. The two arrays combined have almost as much surface area as a pingpong table. Before landing, these are stowed in a radially folded configuration similar to a folded fan. After they have been deployed, the lander's two arrays will together generate up to about 3,000 watt hours per Martian day.\",\n            highlightFunctionName: \"highlightSolarPanels\",\n            cameraTarget: \"deck\",\n            anchorTarget: \"location_solar_panels\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"ICC\": {\n            name: \"Instrument Context Camera\",\n            description: \"The lander's Instrument Context Camera (ICC), is mounted just below the deck, on the edge of the lander facing the workspace, which is the area of ground within reach of the arm.\",\n            highlightFunctionName: \"highlightICC\",\n            cameraTarget: \"ICC\",\n            anchorTarget: \"ICC\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n            indent: true\n        },\n        \"arm_for_glow\": {\n            name: \"Instrument Deployment Arm\",\n            description: \"The Instrument Deployment Arm (IDA) includes a grapple for grasping each piece of hardware the arm will lift. The grapple's five mechanical fingers can close around a handle that resembles a ball on top of a stem. Each of the three items the arm will lift has one of these handles. The three items are the Seismic Experiment for Interior Structure, the Heat Flow and Physical Properties Probe, and the seismometer's Wind and Thermal Shield.The arm is 7.8 feet (2.4 meters) long, with shoulder, elbow and wrist joints and four motors. The grapple is at the end of the arm. The arm-mounted camera is between the elbow and wrist.\",\n            highlightFunctionName: \"highlightArm\",\n            cameraTarget: \"arm_01_c\",\n            anchorTarget: \"arm_01_c\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"IDC\": {\n            name: \"Instrument Deployment Camera\",\n            description: \"The camera on the arm is called the Instrument Deployment Camera (IDC). The IDC's field of view is 45 degrees wide and tall. Movement of the arm is used to point the camera. The IDC will image the workspace in detail to support selection of the best specific locations for the deployed instruments. It will also image hardware to verify key steps are accomplished in the deployment process before proceeding to the next step. Pairs of images taken with this camera's position moved between the exposures can be used for stereo views to provide three-dimensional information. The camera can be pointed in any direction\",\n            highlightFunctionName: \"highlightIDC\",\n            cameraTarget: \"IDC\",\n            anchorTarget: \"IDC\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n            indent: \"1em\",\n        },\n        \"grapple\": {\n            name: \"Grapple\",\n            description: \"The Instrument Deployment Arm (IDA) includes a grapple for grasping each piece of hardware the arm will lift. The grapple's five mechanical fingers can close around a handle that resembles a ball on top of a stem. Each of the three items the arm will lift has one of these handles. The three items are the Seismic Experiment for Interior Structure, the Heat Flow and Physical Properties Probe, and the seismometer's Wind and Thermal Shield.\",\n            highlightFunctionName: \"highlightGrapple\",\n            cameraTarget: \"grapple\",\n            anchorTarget: \"grapple\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n            indent: \"1em\",\n        },\n        \"SEIS_baked\": {\n            name: \"SEIS Instrument\",\n            description: \"The Seismic Experiment for Interior Structure (SEIS), a seismometer that measures ground motions in a range of frequencies will be set directly onto the ground, connected to the lander by a flexible tether containing power and data lines. Then an additional protective cover -- the Wind and Thermal Shield -- will be placed over it.\",\n            highlightFunctionName: \"highlightSEIS\",\n            cameraTarget: \"SEIS_baked\",\n            anchorTarget: \"SEIS_baked\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"WTS_v3d_baked\": {\n            name: \"Wind and Thermal Shield\",\n            description: \"NASAs Jet Propulsion Laboratory, Pasadena, California, made the tether and the Wind and Thermal Shield, which includes a skirt of chainmail to accommodate uneven ground beneath a rigid dome.\",\n            highlightFunctionName: \"highlightShield\",\n            cameraTarget: \"WTS_v3d_baked\",\n            anchorTarget: \"WTS_v3d_baked\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"TWINS\": {\n            name: \"Temperature/Wind Sensors\",\n            description: \"Two finger-size booms mounted on short vertical supports on InSight's deck will monitor atmospheric temperature and the direction and velocity of the wind. The booms face outward in roughly opposite sides of the lander.\",\n            highlightFunctionName: \"highlightTWINS\",\n            cameraTarget: \"TWINS\",\n            anchorTarget: \"TWINS\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"HP3_v3d_baked\": {\n            name: \"HP Instrument\",\n            description: \"InSight's second dedicated science instrument, the Heat Flow and Physical Properties Probe (HP<sup>3</sup>, pronounced \\\"H-P cubed\\\"), will provide the first precise determination of the amount of heat escaping from the planet's interior. InSight's robotic arm will place the instrument on the ground, where a self-hammering mechanical mole will burrow to a depth of 10 to 16 feet (3 to 5 meters) over the course of about 30 days.\",\n            highlightFunctionName: \"highlightHP3\",\n            cameraTarget: \"HP3_v3d_baked\",\n            anchorTarget: \"HP3_v3d_baked\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"RISE_antennas\": {\n            name: \"RISE Antenna\",\n            description: \"The Rotation and Interior Structure Experiment (RISE) does not have its own dedicated science instrument; instead, it uses InSight's direct radio connection with Earth to assess perturbations of Mars' rotation axis, which can provide information about the planet's core. The tools for RISE are the X-band radio on the InSight lander and the large dish antennas of NASA's Deep Space Network. The lander's radio link to Earth will provide precise tracking of the location of one site on the surface as the planet rotates, throughout the course of a full Mars year.\",\n            highlightFunctionName: \"highlightRISE\",\n            cameraTarget: \"RISE_antennas\",\n            anchorTarget: \"RISE_antennas\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"UHF_antenna\": {\n            name: \"UHF Antenna\",\n            description: \"The primary method for sending data to Earth from the landing site will be via UHF relay to an orbiter, through the lander's helical antenna. Mars Reconnaissance Orbiter and Mars Odyssey each will pass in the sky over InSight twice per Martian day. NASA's MAVEN orbiter and the European Space Agency's Trace Gas Orbiter and Mars Express can serve as backup relay assets for InSight. Orbiters will receive transmissions from InSight via UHF and relay the InSight data to Earth via X-band.\",\n            highlightFunctionName: \"highlightUHF\",\n            cameraTarget: \"UHF_antenna\",\n            anchorTarget: \"UHF_antenna\",\n            anchorOffset: new Float32Array([-1, -1.32, -1.32]),\n        },\n        \"pressure_inlet\": {\n            name: \"Pressure Inlet\",\n            description: \"InSight's atmospheric pressure sensor sits inside the lander, with access to the atmosphere via an inlet on the lander deck.\",\n            highlightFunctionName: \"highlightPressureInlet\",\n            cameraTarget: \"pressure_inlet\",\n            anchorTarget: \"pressure_inlet\",\n            anchorOffset: new Float32Array([-1, -1.32, -1]),\n        }\n    }\n}\n\n\n//# sourceURL=webpack:///./src/uidata/parts.js?");

